import { Canvas } from "@react-three/fiber";
import Box from "./component/cube.jsx";

function App() {
  return (



        <Canvas>
      <ambientLight intensity={1} />
      <spotLight position={[10, 10, 10]} angle={0.15} />
      <Box position={[-1.2, 0, 0]} />
      <Box position={[1.2, 0, 0]} />
    </Canvas>



  );
}

export default App;
